import { useEffect } from "react";

export default function PokemonBasic({ p }) {
  useEffect(() => {
    console.log(p);
  }, [p]);

  const BasicInfo = ({name, value}) => <p><span>{name}</span> {value}</p>;

  return (
    <div>
      <p className="p-name">{p.pokemonId}</p>
      <BasicInfo name={"Role"} value={p.role}/>
      <BasicInfo name={"Dificulty"} value={p.difficulty}/>
    </div>
  );
}
